import { TextField } from '@mui/material';
import './App.css';
import './MyApp';
import MyApp from './MyApp';

function App() {
  return (
    <div className="App">
    <h1> NoteTakey </h1>
    <MyApp></MyApp>
    <TextField id="outlined-required" label="Required" variant="filled" />
    </div>
  );
}

export default App;
